import React from 'react';
import axios from 'axios';

axios.get('http://localhost:5000/device_summary')
    .then(res => {
        console.log("hi");
    })
    .catch(error => {
        console.log(error);
    })
export default class App extends React.Component {

    render() {
        return (axios.get('http://localhost:5000/device_summary'));
    }
}
